package easy.LC387;

import org.junit.jupiter.api.Assertions;
import org.junit.jupiter.api.DisplayName;
import org.junit.jupiter.api.Test;

public class FirstUniqueCharacterStringTest {

    FirstUniqueCharacterString obj = new FirstUniqueCharacterString();

    @Test
    @DisplayName("Example 5: Input : s  = \"leetcode\"")
    void example5(){
        Assertions.assertEquals(0, obj.firstUniqChar("leetcode"));
    }

    @Test
    @DisplayName("Example 6: Input :  s = \"loveleetcode\"")
    void example6(){
        Assertions.assertEquals(2, obj.firstUniqChar("loveleetcode"));
    }

    @Test
    @DisplayName("Example 7: Input :  s = \"aabb\"")
    void example7(){
        Assertions.assertEquals(-1 ,  obj.firstUniqChar("aabb"));
    }


    @Test
    @DisplayName("Example 8: Long")
    void example8(){
        Assertions.assertEquals(-1 ,  obj.firstUniqChar(""));
    }


}
